int nearestExit(vector<vector<char>>& maze, vector<int>& entrance) {
    queue<pair<int, int>> q;
    maze[entrance[0]][entrance[1]] = '#';
    q.emplace(entrance[0], entrance[1]);
    int ans = 0;
    int n = maze.size(), m = maze[0].size();
    vector<vector<int>> dirs = {{-1,0},{0,1},{1,0},{0,-1}};
    while (!q.empty()) {
        int k = q.size();
        ans++;
        while (k--) {
            pair<int, int> tp = q.front();
            q.pop();
            int i = tp.first, j = tp.second;
            for (auto& dir : dirs) {
                int newi = i + dir[0];
                int newj = j + dir[1];
                if (newi >= 0 && newj >= 0 && newi < n && newj < m && maze[newi][newj] == '.') {
                    if (newi == 0 || newj == 0 || newi == n-1 || newj == m-1)
                        return ans;
                    q.emplace(newi, newj);
                    maze[newi][newj] = '+';
                }
            }
        }
    }
    return -1;
}

